import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
const YaziListesi=(props)=>{
    const [yaziListesi, setYaziListesi] = useState([]);
    useEffect(() => {
      axios.get('https://reacr-yazi-yorum.herokuapp.com/posts')
        .then((response) => {
          setYaziListesi(response.data);

        })
    }, [])
    return <div>

<div className="ui relaxed divided list">

        {yaziListesi.map(yazi => {

            return (
              <div className="item" key={yazi.id}>
                <img className="ui avatar image" src="/images/avatar2/small/rachel.png" />
                <div className="content">
               <Link to="/posts/" className="header">{yazi.title}</Link>
                  <div className="description">{yazi.created_at} </div>
                </div>
              </div>

            )

          })}

        </div>
    </div>
}
export default YaziListesi
